import React from "react";
import Aside from "./Components/Aside";
import Slider from "./Components/Slider";
import Topnavicon2 from "./Components/Topnavbar_section/Topnavicon2";
import Live_end_upcom from "./Components/Live_end_upcom";
import Sort_by from "./Components/Sort_by";
import My_Pools from "./Components/My_Pools";
import Search_sec from "./Components/Search_sec";
import TopNavAllThree from "./Components/Topnavbar_section/TopNavAllThree";
import Arbor_project from "./Components/Box_section/Arbor_project";
import Venus from "./Components/Box_section/Venus";
import Voyagar from "./Components/Box_section/Voyagar";
import Waxp from "./Components/Box_section/Waxp";
import Xsg_token from "./Components/Box_section/Xsg_token";
import Gnosis from "./Components/Box_section/Gnosis";
import LaunchpadPoolsBox from "./Components/Box_section/LaunchpadPoolsBox";

class Home extends React.Component {
  render() {
    return (
      <div>
        {/* content1 */}
        <Aside />
        {/*  */}
        <div className="form-block">
          <TopNavAllThree
            title="Launchpad"
            subtitle="Pools"
            mainpara="Discover upcoming or live sales."
          />

          <Topnavicon2 />

          <div className="clear"></div>
          {/* content1 slider */}

          <Slider />

          {/* content1 slider */}
          <div className="clear"></div>

          {/* content */}
          <div className="fl-container">
            <div className="outer_box_1 fl-left">
              <Live_end_upcom />
            </div>
            <div className="outer_box_2 fl-left ">
              <My_Pools />
            </div>
            <Sort_by />
            <div className="outer_box_4 fl-right">
              <Search_sec />
            </div>
          </div>

          <div className="outer_box">
            {/* box1 */}
            <LaunchpadPoolsBox
              coinlogo="/img/RIP_logo (1).png"
              coinname="Arbor Project"
              subtitle1="Payment"
              subtitle2="Web3"
              capimg="/img/RIP.png"
              capamt="240,00"
            />
            <Arbor_project />
            {/* box2 */}
            <Venus />
            {/* box3 */}
            <Voyagar />
            {/* box4 */}
            <Waxp />
            {/* box5 */}
            <Xsg_token />
            {/* box6 */}
            <Gnosis />
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
